import logo from './waffle_logo.svg';
import './App.css';

function App() {
  return (
    <div className="Wrap">
      <div className="Head">
        <img className="Logo" src={logo} alt="Logo"/>
        <h1>와플스튜디오메뉴관리</h1>
      </div>

      <div className="Body">
        <span>이름 검색: </span><input></input>
        <div className="MenuBox">

        </div>
      </div>
    </div>
  );
}

export default App;
